	public static String getSyntaxElementID(atl.resource.atl.grammar.AtlSyntaxElement syntaxElement) {
		if (syntaxElement == null) {
			// null indicates EOF
			return "<EOF>";
		}
		for (java.lang.reflect.Field field : atl.resource.atl.grammar.AtlGrammarInformationProvider.class.getFields()) {
			Object fieldValue;
			try {
				fieldValue = field.get(null);
				if (fieldValue == syntaxElement) {
					String id = field.getName();
					return id;
				}
			} catch (Exception e) { }
		}
		return null;
	}
	
	public static atl.resource.atl.grammar.AtlSyntaxElement getSyntaxElementByID(String syntaxElementID) {
		try {
			return (atl.resource.atl.grammar.AtlSyntaxElement) atl.resource.atl.grammar.AtlGrammarInformationProvider.class.getField(syntaxElementID).get(null);
		} catch (Exception e) {
			return null;
		}
	}
	
