	/**
	 * Returns all keywords of the grammar. This includes all literals for boolean and
	 * enumeration terminals.
	 */
	public java.util.Set<String> getKeywords() {
		if (this.keywords == null) {
			this.keywords = new java.util.LinkedHashSet<String>();
			for (atl.resource.atl.grammar.AtlRule rule : RULES) {
				findKeywords(rule, this.keywords);
			}
		}
		return keywords;
	}
	
	/**
	 * Finds all keywords in the given element and its children and adds them to the
	 * set. This includes all literals for boolean and enumeration terminals.
	 */
	private void findKeywords(atl.resource.atl.grammar.AtlSyntaxElement element, java.util.Set<String> keywords) {
		if (element instanceof atl.resource.atl.grammar.AtlKeyword) {
			keywords.add(((atl.resource.atl.grammar.AtlKeyword) element).getValue());
		} else if (element instanceof atl.resource.atl.grammar.AtlBooleanTerminal) {
			keywords.add(((atl.resource.atl.grammar.AtlBooleanTerminal) element).getTrueLiteral());
			keywords.add(((atl.resource.atl.grammar.AtlBooleanTerminal) element).getFalseLiteral());
		} else if (element instanceof atl.resource.atl.grammar.AtlEnumerationTerminal) {
			atl.resource.atl.grammar.AtlEnumerationTerminal terminal = (atl.resource.atl.grammar.AtlEnumerationTerminal) element;
			for (String key : terminal.getLiteralMapping().keySet()) {
				keywords.add(key);
			}
		}
		for (atl.resource.atl.grammar.AtlSyntaxElement child : element.getChildren()) {
			findKeywords(child, this.keywords);
		}
	}
	
